                  links: {
                    color: "##3CA9D1",
                    distance: 150,
                    enable: true,
                    opacity: 0.5,
                    width: 1,
            }



                }

}

class App extends Component  {
  render(){
    return (    
      <div className="App">
        <Particles
          options={particlesOptions}
        />
        <Navigation />
        <Logo />
        <Rank />
        <ImageLinkForm />
        {/*
